import birdsActionTypes from "./birds.types";

const INITIAL_STATE = {
  birdsFirstPage: null,
};

const birdReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case birdsActionTypes.FETCH_IMAGE_SUCCESS:
      return {
        ...state,
        birdsImages: action.payload,
      };
    default:
      return {
        ...state,
      };
  }
};

export default birdReducer;
